import React from 'react';
import styled from 'styled-components';

const AboutContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 4rem 2rem;
`;

const PageTitle = styled.h1`
  text-align: center;
  font-size: 2.5rem;
  margin-bottom: 3rem;
  color: #2c3e50;
`;

const AboutSection = styled.section`
  margin-bottom: 4rem;
`;

const SectionTitle = styled.h2`
  font-size: 2rem;
  margin-bottom: 1.5rem;
  color: #3498db;
`;

const Content = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 3rem;
  align-items: center;
  margin-bottom: 3rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const TextContent = styled.div`
  p {
    font-size: 1.1rem;
    line-height: 1.8;
    color: #555;
    margin-bottom: 1rem;
  }
`;

const ImagePlaceholder = styled.div`
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  height: 300px;
  border-radius: 10px;
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 1.5rem;
  font-weight: bold;
`;

const StatsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 2rem;
  margin-top: 3rem;
`;

const StatCard = styled.div`
  text-align: center;
  padding: 2rem;
  background: white;
  border-radius: 10px;
  box-shadow: 0 5px 15px rgba(0, 0, 0, 0.1);

  h3 {
    font-size: 2.5rem;
    color: #e74c3c;
    margin-bottom: 0.5rem;
  }

  p {
    color: #7f8c8d;
    font-weight: 500;
  }
`;

const AboutPage = () => {
  return (
    <AboutContainer>
      <PageTitle>회사 소개</PageTitle>

      <AboutSection>
        <Content>
          <TextContent>
            <SectionTitle>우리의 이야기</SectionTitle>
            <p>
              2020년에 설립된 우리 회사는 혁신적인 기술 솔루션을 통해 
              고객의 비즈니스 성장을 돕는 것을 목표로 합니다.
            </p>
            <p>
              우리는 최신 기술 트렌드를 파악하고, 고객의 요구사항에 
              맞는 맞춤형 솔루션을 제공합니다. 항상 고객 중심의 
              사고방식으로 접근하여 최고의 결과를 만들어냅니다.
            </p>
          </TextContent>
          <ImagePlaceholder>
            회사 이미지
          </ImagePlaceholder>
        </Content>
      </AboutSection>

      <AboutSection>
        <SectionTitle>우리의 가치</SectionTitle>
        <Content>
          <ImagePlaceholder>
            가치 이미지
          </ImagePlaceholder>
          <TextContent>
            <p>
              <strong>혁신:</strong> 끊임없는 혁신을 통해 새로운 
              가능성을 만들어갑니다.
            </p>
            <p>
              <strong>신뢰:</strong> 고객과의 신뢰 관계를 최우선으로 
              생각합니다.
            </p>
            <p>
              <strong>품질:</strong> 최고의 품질을 제공하기 위해 
              끊임없이 노력합니다.
            </p>
            <p>
              <strong>협력:</strong> 팀워크와 협력을 통해 
              더 큰 성과를 만들어갑니다.
            </p>
          </TextContent>
        </Content>
      </AboutSection>

      <AboutSection>
        <SectionTitle>우리의 성과</SectionTitle>
        <StatsGrid>
          <StatCard>
            <h3>500+</h3>
            <p>만족한 고객</p>
          </StatCard>
          <StatCard>
            <h3>1000+</h3>
            <p>완료된 프로젝트</p>
          </StatCard>
          <StatCard>
            <h3>50+</h3>
            <p>전문가 팀</p>
          </StatCard>
          <StatCard>
            <h3>5년</h3>
            <p>업계 경험</p>
          </StatCard>
        </StatsGrid>
      </AboutSection>
    </AboutContainer>
  );
};

export default AboutPage;
